.visionPassionResults {
  &__content {
    padding-bottom: 72px;
    background-color: #fff;
    text-align: center;

    @include onTablet {
      padding: 200px 0;

      background-image: url(../images/Shapes.png);
      background-position: 50%;
      background-size: contain;
      background-repeat: no-repeat;
    }
  }

  &__container {
    display: flex;
    flex-direction: column;
    align-items: center;
  }

  &__title {
    text-align: center;
    padding-top: 72px;

    font-weight: 600;
    font-size: 44px;
    line-height: 120%;

    color: #253757;

    @include onTablet {
      width: 558px;
      font-size: 52px;
      padding-top: 0;
    }
  }

  &__text {
    padding: 24px 0 56px;

    font-weight: 600;
    font-size: 22px;
    line-height: 150%;

    color: #6c788b;

    @include onTablet {
      font-size: 24px;
      padding: 24px 0 64px;
    }

    &--br {
      display: none;

      @include onSmallDesktop {
        display: block;
      }
    }
  }

  &__button {
    width: 100%;
    margin: auto;
    height: 56px;

    @include onTablet {
      width: 264px;
    }
  }
}

sources.styles\\blocks\\send-us-a-message.scss:
.sendUsAMessage {
  &__content {
    padding-top: 72px;
    width: 100%;
    background-color: #2c2c2c;
    border-radius: 30px 30px 0 0;

    @include onTablet {
      padding-top: 180px;
    }

    @include onSmallDesktop {
      padding-bottom: 121px;
    }
  }

  &__title {
    font-weight: 600;
    font-size: 32px;
    line-height: 130%;

    color: #fff;
  }
}

.form {
  &__email {
    @include form;
  }

  &__name {
    @include form;
  }

  &__message {
    @include form;
    resize: none;
    padding-bottom: 0;
    margin-bottom: 56px;
  }

  &__button {
    border: none;
    width: 100%;
    height: 56px;

    @include onTablet {
      width: 264px;
    }
  }
}

.contactUs {
  background-color: #2c2c2c;
  padding: 80px 0;

  @include onTablet {
    padding: 120px 0 140px;
  }

  @include onSmallDesktop {
    padding: 0;
  }

  &__title {
    padding-bottom: 48px;

    font-weight: 600;
    font-size: 32px;
    line-height: 150%;

    color: #fff;

    @include onTablet {
      padding-bottom: 56px;
    }
  }

  &__name {
    margin-bottom: 8px;
    color: #fff;
    opacity: 0.5;
  }

  &__link {
    display: block;
    margin-bottom: 40px;

    font-weight: 600;
    font-size: 24px;
    line-height: 150%;

    text-decoration: none;
    color: #fff;

    &:hover {
      color: $colorBlue;
    }

    @include onTablet {
      margin-bottom: 48px;
    }
  }

  &__social {
    &--name {
      margin-bottom: 16px;
    }

    display: inline-block;
    padding: 4px;
    margin-right: 36px;

    &:hover {
      filter: brightness(0) saturate(100%) invert(23%)
        sepia(93%) saturate(2836%) hue-rotate(220deg)
        brightness(99%) contrast(94%);
    }
  }
}

sources.styles\\blocks\\footer.scss:
.footer {
  &__container {
    @include onSmallDesktop {
      display: flex;
      justify-content: space-between;
      align-items: center;

      padding-bottom: 82px;
    }
  }

  &__content {
    margin: 0 auto;
    background-color: #2c2c2c;
  }

  &__list {
    padding: 50px 0 80px;
    list-style: none;

    @include onTablet {
      display: flex;
      gap: 40px;
      padding: 26px 0 80px;
    }

    @include onSmallDesktop {
      padding: 0;
      gap: 64px;
    }

    &--item {
      padding-bottom: 24px;

      @include onTablet {
        padding-bottom: 0;
      }
    }

    &--link {
      font-weight: 700;
      font-size: 13px;
      line-height: 150%;

      letter-spacing: 3px;
      text-transform: uppercase;
      text-decoration: none;

      color: #fff;

      &:hover {
        color: $colorBlue;
      }
    }
  }
}
